import {
  Box,
  Divider,
  ListItem,
  ListItemIcon,
  ListItemText,
  Typography,
  withStyles,
} from "@material-ui/core";
import { Info } from "@material-ui/icons";

export default function UserDetail({ userInfo }) {
  return (
    <Container>
      <Heading variant="h6">Your Attempts</Heading>

      <ListItem>
        <ListItemIcon>
          <Info />
        </ListItemIcon>
        <ListItemText>
          You have attemtp
        </ListItemText>
      </ListItem>

      <Divider />
    </Container>
  );
}

const Container = withStyles({
  root: {
    display: "flex",
    flexDirection: "column",
  },
})(Box);

const Heading = withStyles({
  root: {
    fontWeight: 600,
    margin: "0.5rem 0",
  },
})(Typography);
